	}

	render(){
		return(
				<div className="row ">
				<div className="col">
					<h1 className=" block_rxjs_subject">Страница не найдена</h1> 
				</div>
			</div>

		)
	}
}

class Restricted extends Component{
	constructor(props){
		super(props)
	}

	render(){
		return(
				<div className="row ">
				<div className="col">
					<h1 className=" block_rxjs_subject">Вы должны зарегистрироваться</h1> 
				</div>
			</div>

		)
	}
}


class Logger extends Component{
	constructor(props){
		super(props)

		this.state={
			userName: "",
			userPass: "",
		}




	}

	componentDidMount(){
			let accessToken = null;

	}

	changeValue(e){
		let value = e.target.value;
		let field = e.target.name;

		let state = Object.assign({}, this.state);
		state[field] = value;
		this.setState(state)

	}

	render(){
		return(
				<div className="row">
					<div className="col">
					<h1>Регистрация</h1>
					<div className=" block_rxjs_subject">
						<Link to={"/"}>Назад</Link>
						<br/>
					<p>Зарегистрируйтесь</p>
					<p><input type="text" value={this.state.userName} onChange={this.changeValue.bind(this)} name="userName" /></p>
					<p><input type="text" value={this.state.userPass} onChange={this.changeValue.bind(this)} name="userPass" /></p>
					<p>
						<button>Войти</button>
						<Link to={"/registration"}>Зарегистрироваться</Link> 
					</p>
					<br/>
					<p>Забыли пароль? </p>
					<p>

						<Link to={"/resetpass"}>Восстановить пароль</Link>
					</p>
					</div>
					</div>
				</div>

		)
	}
}

class Registration extends Component{
	constructor(props){
		super(props)

		this.state={
			userData:{
				userName: "",
				userPass: "",
				userPassRepeat:"",
				acceptTerms: false,
			},
			passwordCheck: null,
			mailCheck: null,
			termsCheck: null
		}




	}

	componentDidMount(){
			let accessToken = null;

	}

	changeValue(e){
		let value = e.target.value;
		let field = e.target.name;

		let state = Object.assign({}, this.state);
		state[field] = value;
		this.setState(state)

	}

	enterTheSystem(e){
		let userData= this.state.userData;


	}

	render(){
		return(
				<div className="row">
					<div className="col">
					<h1>Регистрация</h1>
					<div className=" block_rxjs_subject">
						<Link to={"/"}>Назад</Link>
						<br/>
					<p>Зарегистрируйтесь</p>
					<p><input type="text" value={this.state.userName} placeholder="Ваше имя" onChange={this.changeValue.bind(this)} name="userName" /></p>
					<p><input type="text" value={this.state.userName} placeholder="Ваша почта" onChange={this.changeValue.bind(this)} name="userMail" /></p>
					<p><input type="text" value={this.state.userPass} placeholder="Пароль" onChange={this.changeValue.bind(this)} name="userPass" /></p>
					<p><input type="text" value={this.state.userPassRepeat} placeholder="Повторите пароль" onChange={this.changeValue.bind(this)} name="userPass" /></p>
					<p>
						<button onClick={this.enterTheSystem.bind(this)}>Войти</button>
						<Link to={"/signin"}>Войти</Link> 
					</p>
					<br/>

					</div>
					</div>
				</div>

		)
	}
}

class UserCabinet extends Component{
	constructor(props){
		super(props)

		this.state={
			userName: "",
			userPass: "",
		}




	}

	componentDidMount(){
			let accessToken = null;

	}

	changeValue(e){
		let value = e.target.value;
		let field = e.target.name;

		let state = Object.assign({}, this.state);
		state[field] = value;
		this.setState(state)

	}

	render(){
		return(
				<div className="row">
					<div className="col">
					<h1>Регистрация</h1>
					<div className=" block_rxjs_subject">
						<Link to={"/"}>Назад</Link>
						<br/>
					<p>Зарегистрируйтесь</p>
					<p><input type="text" value={this.state.userName} onChange={this.changeValue.bind(this)} name="userName" /></p>
					<p><input type="text" value={this.state.userPass} onChange={this.changeValue.bind(this)} name="userPass" /></p>
					<p>
						<button>Войти</button>
						<Link to={"/registration"}>Зарегистрироваться</Link> 
					</p>
					<br/>
					<p>Забыли пароль? </p>
					<p>

						<Link to={"/resetpass"}>Восстановить пароль</Link>
					</p>
					</div>
					</div>
				</div>

		)
	}
}

class Main extends Component{
	render(){
		return(

			<MainPage />


		)
	}
}





class MainPage extends Component{

	constructor(props){
		super(props)

		this.state={
			data: []
		}


	}



	render(){
		return(

		<div className="row">
			<div className="ob">
				<div className="block_nav">
				{
				(()=>{
					if(this.props.user == null || this.props.user ==undefined){
						return(
						<React.Fragment>
						<Link to={"/signin"}>Войти</Link> 
						<Link to={"/registration"}>Регистрация</Link> 
						</React.Fragment>
						)

					}else{
						return(
						<React.Fragment>
						<Link to={"/logout"}>Выйти</Link> 
						<Link to={"/usercabinet"}>Личный кабинет</Link> 
						</React.Fragment>
						)	 
					} 
				})()
				}
				<Link to={"/main"}>Главная</Link> 
				<Link to={"/protectedpage"}>Защищенная страница с контентом</Link>
				</div>
			</div>
			<div className="col">
					<div className="ob">
						<h2>Добро пожаловать!</h2>
					</div>
			</div> 
		</div>
		)

	}

}

const PrivateRoute = ({ component: Component, props: props}) => (
  <Route   render={(props) => (
    this.props.user !== null
      ? <Component {...props} />
      : <Redirect to='/signin' />
  )} />
)


class App extends Component {
  render() {
    return (
    <div className="App">
        <header className="App-header"> 
          <h1 >
			ЗАМОТАЕВ КИРИЛЛ

		  </h1> 

		  <div> 
			{this.props.loading 
            ? <p>Loading...</p> 
            : this.props.error
                ? <p>Error, try again</p>
                : <p><img src={this.props.url}/></p>}
			</div>
        </header> 
		<section>
			<Router > 
				<Switch>
					<Route exact path="/" component={()=>{return(<Main />)}} />
					<Route path="/registration" component={()=>{return (<Registration/>)}} /> 
					<Route path="/signin" component={()=>{return (<Logger/>)}} />
					<Route path="/resetpass" component={()=>{return (<RestorePass/>)}} />
					<PrivateRoute path='/protectedpage' component={ProtectedMainPage} />
					<PrivateRoute path="/usercabinet" component={()=>{return (<UserCabinet/>)}} />
					<Route path="*" component={()=>{return (<NotFound/>)}} />
				</Switch> 
			</Router>
		</section>
      </div>
    );
  }
}

export default App;
